import React, { Component } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import Button from '@material-ui/core/Button';


class TimeTable extends Component {

    generateTable = () => {
        this.props.onGenerateTable();
    }

    render(){
        return (
            <React.Fragment style={{marginTop: 200}}>
                <Button style={{marginTop: 50}} color="primary" onClick={this.generateTable}>Generate Table</Button>
                
                <TableContainer style={{marginTop: 100, width: '50%'}} component={Paper}>
                <Table style={{}} aria-label="simple table">
                    <TableHead>
                        <TableRow>
                            <TableCell>Dessert (100g serving)</TableCell>
                            <TableCell align="right">Calories</TableCell>
                            <TableCell align="right">Fat&nbsp;(g)</TableCell>
                            <TableCell align="right">Carbs&nbsp;(g)</TableCell>
                            <TableCell align="right">Protein&nbsp;(g)</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                    
                        <TableRow>
                            <TableCell component="th" scope="row">hi</TableCell>
                            <TableCell align="right">zahid</TableCell>
                            <TableCell align="right">ali</TableCell>
                            <TableCell align="right">kasey</TableCell>
                            <TableCell align="right">ho</TableCell>
                        </TableRow>
                   
                    </TableBody>
                </Table>
                </TableContainer>
            </React.Fragment>
      );    
    }
}

export default TimeTable;
